import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/main",
      name: "main",
      component: () => import("./views/Main.vue")
    },
    {
      path: "/about",
      name: "about",
      component: () => import("./views/About.vue")
    },
    {
      path: "/article/relate/:kmnote",
      name: "relatearticle",
      component: () => import("./views/RelateArticle.vue")
    }
  ]
});
